【商品名】

自動巻きエアーホースリール  （レッド）

　

【特徴】

巻取りには安心の片寄り防止機能がついていますので安心です。
巻き取り式なので作業終了後に巻くといった面倒な作業が無いので非常に便利です


【商品詳細】

ホース長：15Ｍ
ホース材質：PVC（塩化ビニル樹脂性）、PU（ポリウレタン樹脂性）
サイズ：31×29×15
壁や天井などにも取り付け可能です。



